import React from 'react';
import {Button} from 'react-bootstrap'
import logo from './logo.svg';
import './App.css';
//import '@fontawesome/fontawesome-free/css/all.css'

class Header extends React.Component{
  render(){
    return(
      <div>
        <div>
          <i className="fas fa-flask m-3 p-4" style={{
            fontSize: "10rem",
            color: "#blue"
          }}></i></div>
        <div>
          <h1>Northwest Labs</h1>

          <h3>Where all you chemical testing dreams come true!</h3>
        </div>
      </div>
    )
  }
}

class Footer extends React.Component{
  render(){
    var today = new Date();

    return(
      <div>
          <h6> Â© {today.getFullYear()} Northwest Labs</h6>
      </div>
    )
  }
}

class NavBar extends React.Component{
  render(){
    return(
      <Navbar bg="light" expand="lg">
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#link">Link</Nav.Link>
            <NavDropdown title="Dropdown" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
            </NavDropdown>
          </Nav>
          <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <Button variant="outline-success">Search</Button>
          </Form>
        </Navbar.Collapse>
      </Navbar>
    )
  }
}

function App() {
  return (
    <div className="App">
      <NavBar/>
      <header className="App-header">
      <Header/>
      <Button variant="success" size="lg">Get Started today!</Button>
      </header>
      <p>This is some other content that we can put on here</p>
      <Footer/>
    </div>
  );
}

export default App;
